DELETE FROM classes;
DELETE FROM users;
DELETE FROM contests;
DELETE FROM entries;
DELETE FROM reviews;

PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE users (
    id INTEGER PRIMARY KEY,
    name TEXT,
    username TEXT UNIQUE,
    password_hash TEXT,
    super_user BOOLEAN,
    created DATETIME DEFAULT (DATETIME('now'))
);
CREATE TABLE contests (
    id INTEGER PRIMARY KEY,
    title TEXT,
    class_id INTEGER,
    short_description TEXT,
    long_description TEXT,
    anonymity BOOLEAN,
    public_reviews BOOLEAN,
    public_results BOOLEAN,
    collection_end DATE,
    review_end DATE,
    created DATETIME DEFAULT (DATETIME('now')),
    FOREIGN KEY (class_id) REFERENCES classes(id) ON DELETE CASCADE
);
CREATE TABLE entries (
    id INTEGER PRIMARY KEY,
    contest_id INTEGER,
    user_id INTEGER,
    entry TEXT,
    created DATETIME DEFAULT (DATETIME('now')),
    FOREIGN KEY (contest_id) REFERENCES contests(id) ON DELETE CASCADE,
    FOREIGN KEY (user_id) REFERENCES users(id) ON DELETE CASCADE,
    UNIQUE (contest_id, user_id)
);
CREATE TABLE reviews (
    id INTEGER PRIMARY KEY,
    entry_id INTEGER,
    user_id INTEGER,
    points INTEGER,
    review TEXT,
    created DATETIME DEFAULT (DATETIME('now')),
    FOREIGN KEY (entry_id) REFERENCES entries(id) ON DELETE CASCADE,
    FOREIGN KEY (user_id) REFERENCES users(id) ON DELETE CASCADE
);
CREATE TABLE classes (
    id INTEGER PRIMARY KEY,
    title TEXT,
    value TEXT
);
CREATE INDEX idx_users_username ON users(username);
CREATE INDEX idx_entries_contest_user ON entries(contest_id, user_id);
CREATE INDEX idx_entries_user_id ON entries(user_id);
CREATE INDEX idx_entries_contest_id ON entries(contest_id);
CREATE INDEX idx_reviews_entry_id ON reviews(entry_id);
CREATE INDEX idx_reviews_user_id ON reviews(user_id);
CREATE INDEX idx_contests_class_id ON contests(class_id);
COMMIT;
